  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Koyukuk/Nowitna
  National Wildlife Refuge Complex outlines Refuge accomplishments during the 1992
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses the master plan, management planning, public participation, and
  research and investigations. Refuge administration is outlined; information about
  personnel, youth programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, forests,
  fire management, water rights, and wilderness areas. The wildlife section of the
  report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  and marking and bird banding. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, trapping, and law enforcement.
  The equipment and facilities section of the report provides information about rehabilitation,
  major maintenance, equipment replacement, communication systems, and computer systems.\",\n\t\"license_title\":
